import './Home.css';

function Home() {
    return (
        <section class="home">
            <h2>Plongeons, observons et r√©agissons pour l'avenir.</h2>
            <p>Plongez au sein de notre exposition immersive et ambulante qui sensibilise sur l'exploitation des ressources marines.</p>

            <img class="home_image" src="plongeur.gif" alt="Plongeur" />
            <img class="home_image_tortue" src="tortue.png" alt="Tortue" />

        </section>
    );
}

export default Home;
